  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey Coastal and
  Marine Geology Program (CMGP) Pacific Coastal and Marine Science Center (PCMSC)n
  \              Samples Repository is a partner in the Index to Marine and Lacustrine
  Geological Samples (IMLGS) database. The n               Curator sends data and
  information related to the PCMSC marine geological sample collection to NCEI to
  increase theirn               discoverability via the IMLGS. Selected data, documents,
  and images related to the collection are alson               archived at NCEI and
  discoverable via the IMLGS, but the USGS is the authoritative source for all data
  and informationn               related to USGS geological samples.\",\n\t\"owner_org\":
